column8:
　☆メルちゃんとネネちゃんで、いろいろなメニューが選べる<br>
フードコートです☆<br><br><br>

たべもののパーツをセットして、メルちゃんが受け取りに立つと…<br>
たべものがでてきちゃう! レジはボタンを押すと開きます。<br>
<br>☆たべものは、食べたように見えちゃうギミック付。<br><br><br>

※お人形は付属しません※<br><br><br>



■対象性別:女の子<br>
■電池不要<br>
■ST取得<br>
■製造国 :中国<br>
■対象年齢 :3才以上<br>
