　リラックマとリカちゃんが初めてコラボレーション♪<br>
かわいいリラックマ柄のワンピースに、リラックマのぬいぐるみ、<br>カチューシャをつけたリカちゃんです。<br>
パッケージはかわいいリラックマバージョン。<br><br>

[セット内容]<br>
人形(ドレス、下着、イヤリング着用)(1), カチューシャ(1), <br>ぬいぐるみ(1), クツ(1)<br><br>

■対象年齢：3歳から <br>
■パッケージサイズ:125(幅)265(高)40(奥)mm<br><br>

